const isBalloon = (state = false, action) => {
    switch (action.type) {
        case 'CLICKED_BALLOON':
            return !state;
        case 'CLICKED_BALLOON2':
            return state = false;
        default: 
            return state = false;
    }
};

export default isBalloon;
